import { useState, useEffect } from 'react';
import axios from 'axios'
import { useParams } from "react-router";
import Search_box from './search_box.js';
import Menubar from '../elements/menubar';
import Search_title from './search_titlle.js'
import Search_conts from './search_conts.js';
import Paging from '../elements/page.js';

function Test() {
  let [searchData, setSearchData] = useState({});
  const {num} = useParams();
  useEffect(() => {
    async function fetchData() {
      const result = await axios.get(
        "/precedent/detail/" + num
      );
       console.log(result.data);
       setSearchData(result.data);
    }
    fetchData();
  }, [])
  return (
    <div>
    <header id="header">
      <p id="logo">민법을 적용하는 법</p>
      <Menubar/>
      </header>
    <nav id="nav">&nbsp;</nav>
    <div id="section">
        searchData.p_dic === 'undefined' ? (
            loading...
        ) : (
            {searchData.preceList}
            {searchData.p_dic.name_list}
        )
    </div>
    <aside id="aside">&nbsp;</aside>
    <footer></footer>
  </div>
    );

};

export default Test;
